$templateCache.put("js/faq/userFaq-nopay.html","<div class=\"fade-in\">\n    <div class=\"col-md-3 \" ng-style=\"tabSelected == \'users\' && {\'padding-top\' : \'20px\'}\">\n        <ul class=\"nav nav-pills nav-stacked\">\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'general\'\" ng-class=\"{\'active\' : sectionSelected == \'general\'}\"><a href=\"#general\">General</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'order\'\" ng-class=\"{\'active\' : sectionSelected == \'order\'}\"><a href=\"#order\">Order</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'booking\'\" ng-class=\"{\'active\' : sectionSelected == \'booking\'}\"><a href=\"#booking\">Booking</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'payment\'\" ng-class=\"{\'active\' : sectionSelected == \'payment\'}\"><a href=\"#payment\">Payment</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'settings\'\" ng-class=\"{\'active\' : sectionSelected == \'settings\'}\"><a href=\"#settings\">Settings</a></li>\n        </ul>\n    </div>\n\n    <div class=\"col-md-9\">\n        <div id=\"general\">\n\n            <h3 class=\"fa-border bg-info text-center\">General</h3>\n\n            <p><strong>What is SaltdKurry?</strong></p>\n            <p>We are an online community of cooks where you can order home-cooked food or book a personal cook on-demand.</p>\n\n            <p><strong>Why should I use SaltdKurry?</strong></p>\n            <p>\n                Most of us are busy in our day-to-day life to cook at home on a daily basis and eating out everyday may not be an option. Also, studies have shown that eating home-cooked meals lead to better health outcomes than eating out frequently\n                <a href=\"https://www.fix.com/blog/perks-of-home-cooked-meals/\">Health and Social benefits of home-cooked meals</a>.\n                <div class=\"paragraph-style\" style=\"margin-bottom: 20px\">\n                    Eat healthy, delicious home-cooked food or try a different cuisine, a different dish or something exotic all cooked by your personal cook at your convenience. So that you can spend more time with your family or work on your project you always wanted to or catch up with your buddies or just chillax.\n                </div>\n            </p>\n\n            <p><strong>What is SaltdKurry Code of Ethics for cooks?</strong></p>\n            <p>Each cook at SaltdKurry will demonstrate adherence to the <a href=\"/code-of-ethics\">Code of Ethics</a> at all times. Should you feel these standards are not being represented, as a Foodie you are encouraged to discuss this with your cook and/or <a href=\"/contact\">contact us</a>.\n            </p>\n\n            <p><strong>Why the name SaltdKurry?</strong></p>\n            <p>There\'s no salt without curry. Duh!</p>\n        </div>\n        <div id=\"order\">\n\n            <h3 class=\"fa-border bg-info text-center\">Order</h3>\n\n            <p><strong>What is Lunchbox?</strong></p>\n            <p>\n                At SaltdKurry, we want to empower personal cooks as well home based cooks by providing a platform to start their own business.\n                And for a Foodie like you, we want to provide a single platform where you could search all home based or personal cooks.\n                Lunchbox is where you order food from home based cooks.\n            </p>\n\n            <p><strong>How do I place an order?</strong></p>\n            <p>\n                <div class=\"paragraph-style\">\n                    <div>1. Start by entering your address.</div>\n                    <div>2. Select a cook from the search results.</div>\n                    <div>3. Build your Lunchbox.</div>\n                    <div>4. Place order.</div>\n                </div>\n            </p>\n\n            <p><strong>I did not complete the order. Do I have to start over again?</strong></p>\n            <p>\n                No, you can resume from where you left off. Navigate to your dashboard and you can see all your orders which have been STARTED but not PLACED.\n            </p>\n\n            <p><strong>Can I request for Lunchbox delivery?</strong></p>\n            <p>\n                SaltdKurry do not deliver food yet. However, you can make arrangements with the cook for delivery.\n            </p>\n\n            <p><strong>How can I communicate with the cook?</strong></p>\n            <p>Once you request for a cook, you can communicate through our in-app messaging.</p>\n\n            <p><strong>Something came up at the last minute. Can I cancel the order?</strong></p>\n            <p>Unfortunately, you cannot cancel once the order has been placed.\n            </p>\n\n            <p><strong>When can I review my cook?</strong></p>\n            <p>Once your request is completed, you will have an option to review your cook.</p>\n\n        </div>\n        <div id=\"booking\">\n\n            <h3 class=\"fa-border bg-info text-center\">Booking</h3>\n\n            <p><strong>How do I go about requesting a cook?</strong></p>\n            <p>\n                <div class=\"paragraph-style\">\n                    <div>1. Start by entering your address.</div>\n                    <div>2. Select a cook from the search results.</div>\n                    <div>3. Answer simple questions.</div>\n                    <div>4. Request booking.</div>\n                </div>\n            </p>\n\n            <p><strong>I did not complete the request process. Do I have to start over again?</strong></p>\n            <p>\n                No, you can resume from where you left off. Navigate to your dashboard and you can see all your bookings which have been STARTED but not REQUESTED.\n            </p>\n\n            <p><strong>How can I communicate with the cook?</strong></p>\n            <p>Once you request for a cook, you can communicate through our in-app messaging.</p>\n\n            <p><strong>Something came up at the last minute. Can I cancel the booking?</strong></p>\n            <p>We understand - life happens, plans change. For that same reason we have provided a way to cancel your booking.\n                However, we encourage you to plan well in advance and notify your cook of your cancellation.\n            </p>\n\n            <p><strong>When can I review my cook?</strong></p>\n            <p>Once your request is completed, you will have an option to review your cook.</p>\n\n        </div>\n        <div id=\"payment\">\n\n            <h3 class=\"fa-border bg-info text-center\">Payment</h3>\n\n            <p><strong>How do I pay?</strong></p>\n            <p>We at SaltdKurry, do not involve in money transactions in your region at this time. Please make arrangements with the cook for any payments.</p>\n\n        </div>\n        <div id=\"settings\">\n\n            <h3 class=\"fa-border bg-info text-center\">Settings</h3>\n\n            <p><strong>How do I receive notifications?</strong></p>\n            <p>\n                By default, you will receive email notifications. If you would like to receive push notifications to any device, simply follow the instructions below.\n                <div class=\"paragraph-style\">\n                    <div>1. Login to SaltdKurry on the intended device through your browser</div>\n                    <div>2. Navigate to Settings</div>\n                    <div>3. Subscribe to Push Notification</div>\n                </div>\n            </p>\n\n            <p><strong>How can I change my profile picture?</strong></p>\n            <p>Under settings, either click on change profile picture or drag and drop your image within the area.</p>\n\n            <p><strong>Why is it important to verify my identity?</strong></p>\n            <p>Identity Verification could be done through Google or Facebook so that we know who you are. If you have not signed up using Google or Facebook, you will be asked to do so to confirm your identity.</p>\n\n        </div>\n    </div>\n\n</div>");
$templateCache.put("js/faq/userFaq.html","<div class=\"fade-in\">\n    <div class=\"col-md-3 \" ng-style=\"tabSelected == \'users\' && {\'padding-top\' : \'20px\'}\">\n        <ul class=\"nav nav-pills nav-stacked\">\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'general\'\" ng-class=\"{\'active\' : sectionSelected == \'general\'}\"><a href=\"#general\">General</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'order\'\" ng-class=\"{\'active\' : sectionSelected == \'order\'}\"><a href=\"#order\">Order</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'booking\'\" ng-class=\"{\'active\' : sectionSelected == \'booking\'}\"><a href=\"#booking\">Booking</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'payment\'\" ng-class=\"{\'active\' : sectionSelected == \'payment\'}\"><a href=\"#payment\">Payment</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'settings\'\" ng-class=\"{\'active\' : sectionSelected == \'settings\'}\"><a href=\"#settings\">Settings</a></li>\n        </ul>\n    </div>\n\n    <div class=\"col-md-9\">\n        <div id=\"general\">\n\n            <h3 class=\"fa-border bg-info text-center\">General</h3>\n\n            <p><strong>What is SaltdKurry?</strong></p>\n            <p>We are an online community of cooks where you can order home-cooked food or book a personal cook on-demand.</p>\n\n            <p><strong>Why should I use SaltdKurry?</strong></p>\n            <p>\n                Most of us are busy in our day-to-day life to cook at home on a daily basis and eating out everyday may not be an option. Also, studies have shown that eating home-cooked meals lead to better health outcomes than eating out frequently\n                <a href=\"https://www.fix.com/blog/perks-of-home-cooked-meals/\">Health and Social benefits of home-cooked meals</a>.\n                <div class=\"paragraph-style\" style=\"margin-bottom: 20px\">\n                    Eat healthy, delicious home-cooked food or try a different cuisine, a different dish or something exotic all cooked by your personal cook at your convenience. So that you can spend more time with your family or work on your project you always wanted to or catch up with your buddies or just chillax.\n                </div>\n            </p>\n\n            <p><strong>What is SaltdKurry Code of Ethics for cooks?</strong></p>\n            <p>Each cook at SaltdKurry will demonstrate adherence to the <a href=\"/code-of-ethics\">Code of Ethics</a> at all times. Should you feel these standards are not being represented, as a Foodie you are encouraged to discuss this with your cook and/or <a href=\"/contact\">contact us</a>.\n            </p>\n\n            <p><strong>Why the name SaltdKurry?</strong></p>\n            <p>There\'s no salt without curry. Duh!</p>\n        </div>\n        <div id=\"order\">\n\n            <h3 class=\"fa-border bg-info text-center\">Order</h3>\n\n            <p><strong>What is Lunchbox?</strong></p>\n            <p>\n                At SaltdKurry, we want to empower personal cooks as well home based cooks by providing a platform to start their own business.\n                And for a Foodie like you, we want to provide a single platform where you could search all home based or personal cooks.\n                Lunchbox is where you order food from home based cooks.\n            </p>\n\n            <p><strong>How do I place an order?</strong></p>\n            <p>\n                <div class=\"paragraph-style\">\n                    <div>1. Start by entering your address.</div>\n                    <div>2. Select a cook from the search results.</div>\n                    <div>3. Build your Lunchbox.</div>\n                    <div>4. Place order.</div>\n                </div>\n            </p>\n\n            <p><strong>I did not complete the order. Do I have to start over again?</strong></p>\n            <p>\n                No, you can resume from where you left off. Navigate to your dashboard and you can see all your orders which have been STARTED but not PLACED.\n            </p>\n\n            <p><strong>Can I request for Lunchbox delivery?</strong></p>\n            <p>\n                SaltdKurry do not deliver food yet. However, you can make arrangements with the cook for delivery.\n            </p>\n\n            <p><strong>How can I communicate with the cook?</strong></p>\n            <p>Once you request for a cook, you can communicate through our in-app messaging.</p>\n\n            <p><strong>Something came up at the last minute. Can I cancel the order?</strong></p>\n            <p>Unfortunately, you cannot cancel once the order has been placed.\n            </p>\n\n            <p><strong>When can I review my cook?</strong></p>\n            <p>Once your request is completed, you will have an option to review your cook.</p>\n\n        </div>\n        <div id=\"booking\">\n\n            <h3 class=\"fa-border bg-info text-center\">Booking</h3>\n\n            <p><strong>How do I go about requesting a cook?</strong></p>\n            <p>\n                <div class=\"paragraph-style\">\n                    <div>1. Start by entering your address.</div>\n                    <div>2. Select a cook from the search results.</div>\n                    <div>3. Answer simple questions.</div>\n                    <div>4. Request booking.</div>\n                </div>\n            </p>\n\n            <p><strong>I did not complete the request process. Do I have to start over again?</strong></p>\n            <p>\n                No, you can resume from where you left off. Navigate to your dashboard and you can see all your bookings which have been STARTED but not REQUESTED.\n            </p>\n\n            <p><strong>How can I communicate with the cook?</strong></p>\n            <p>Once you request for a cook, you can communicate through our in-app messaging.</p>\n\n            <p><strong>Something came up at the last minute. Can I cancel the booking?</strong></p>\n            <p>We understand - life happens, plans change. For that same reason we have provided a way to cancel your booking.\n                However, we encourage you to plan well in advance and notify your cook of your cancellation.\n            </p>\n\n            <p><strong>When can I review my cook?</strong></p>\n            <p>Once your request is completed, you will have an option to review your cook.</p>\n\n        </div>\n        <div id=\"payment\">\n\n            <h3 class=\"fa-border bg-info text-center\">Payment</h3>\n\n            <p><strong>How do I pay?</strong></p>\n            <p>You need to setup a payment method to be able to authorize payment. We have integrated with Stripe (a third-party payment gateway) which stores all your sensitive financial data. Please visit Stripe for more details\n                <a rel=\"noopener\" href=\"https://stripe.com\">https://stripe.com</a>\n            </p>\n\n            <p><strong>Does SaltdKurry store my financial details?</strong></p>\n            <p>No we do not. We have integrated with Stripe (a third-party payment gateway) which stores all your sensitive financial data. Please visit Stripe for more details\n                <a rel=\"noopener\" href=\"https://stripe.com\">https://stripe.com</a>\n            </p>\n\n            <p><strong>What is Stripe?</strong></p>\n            <p>Stripe is a third-party payment gateway to accept credit and debit card payments online. Please visit Stripe for more details\n                <a rel=\"noopener\" href=\"https://stripe.com\">https://stripe.com</a>\n            </p>\n\n            <p><strong>How does the payment work?</strong></p>\n            <p>We authorize payment at the time of your order/booking and when the cook completes the order/booking, we charge you the final amount.</p>\n\n        </div>\n        <div id=\"settings\">\n\n            <h3 class=\"fa-border bg-info text-center\">Settings</h3>\n\n            <p><strong>How do I receive notifications?</strong></p>\n            <p>\n                By default, you will receive email notifications. If you would like to receive push notifications to any device, simply follow the instructions below.\n                <div class=\"paragraph-style\">\n                    <div>1. Login to SaltdKurry on the intended device through your browser</div>\n                    <div>2. Navigate to Settings</div>\n                    <div>3. Subscribe to Push Notification</div>\n                </div>\n            </p>\n\n            <p><strong>How can I change my profile picture?</strong></p>\n            <p>Under settings, either click on change profile picture or drag and drop your image within the area.</p>\n\n            <p><strong>Why is it important to verify my identity?</strong></p>\n            <p>Identity Verification could be done through Google or Facebook so that we know who you are. If you have not signed up using Google or Facebook, you will be asked to do so to confirm your identity.</p>\n\n        </div>\n    </div>\n\n</div>");
